import './App.css';
import './Test.js';
import images from './images/tools.jpg';
import logo from './images/customer-obsession-logo.png';

import React from 'react';

function Header(props) {
  return (
    <div className='container'>
    <header className='row'>
    <div className='col-sm-6'>
	     <h1>Main Heading Is Here {props.name}</h1>
    </div>
    <div className='col-sm-6'>
        <h1>{props.name} Was Is Here </h1>
    </div>
    </header>
    </div>
  );
}

function MainHeader() {
  return (
    <header className="co-header">
      <div className="menu-area">
        <div className="container">
          <div className="row align-items-center">
            <div className="col-lg-6">
              <div className="logo-area text-right"> <a href="index.html"><img src={logo} alt="logo" /></a> </div>
            </div>
            <div className="col-lg-6 text-left">
              <div className="co-menu-area">
                <ul>
                    <li><a href="terms.html" class="main-btn">Terms & Conditions</a></li>
                  </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
}



class Product extends React.Component {
render() {
return (
<div className='item'>
<div className='image'>
    <img src={images} alt='myne' />
    </div>
    <div className='middle aligned content'>
    <div className='description'>
    <a>Fort Knight</a>
    <p>Authentic renaissance actors, delivered in just two week\
    s.</p>
    </div>
    <div className='extra'>
    <span>Submitted by:</span>
    <img
    className='ui avatar image'
    src={images}
    />
    </div>
    </div>
    </div>
);
}
}

function Main(props) {
  return (
    <section>
      <p>
        We serve the most {props.adjective} food around.
      </p>
      <ul style={{ textAlign: "left" }}>
        {props.dishes.map(dish => (
          <li key={dish.id}>{dish.title}</li>
        ))}
      </ul>
    </section>
  );
}


function Footer(props){
	return(
		<footer>
			<ul>
			 <li>Footer 1</li>
			<li>Footer 2</li>
			<li>Footer {props.year}</li>
			</ul>
		</footer>
	)
}

const dishes = [
	"Musa",
	"Tivo",
	"Kevin",
	"Steve"
];

const dishObjects = dishes.map((dish, i) => ({
  id: i,
  title: dish
}));

function Head(props) {
  return (
    <header>
	  <h1>Main Heading Is ? {props.name}</h1>
    </header>
  );
}

class Test extends React.Component{
  render() {
    return (
      <div className="Test">
  	  <Head name="Done Deal"/>
      </div>
    );
  }
}

class ProductList extends React.Component {
  render() {
    return (
    <div className='ui unstackable items'>
    Hello, friend! I am a basic React component.
    </div>
    );
  }
}

class App extends React.Component{
  render(){
  return (
    <div className="App">
    <MainHeader />
    </div>
  );
  }
}



export default App;
